// import './Button.css';
import React from "react";
class BtnClicks extends React.Component{
   btn = "";
  constructor(props){
    super(props);
    this.state = {btn: ""};
  }
  buttonClick = () => {
    return (
      this.setState({btn: 1})
    );
  }
}


export default BtnClicks;
